import React from "react";
import ReactDom from "react-dom";
import "./index.css";
import bro from"./Used Images/bro.png";
import OsumareLogo from "./OsumareLogo.png";

function Nav(){
    return(<>
     <nav class="navbar fixed-top" style={{backdropFilter:"blur(10px)",WebkitBackdropFilter:"blur(10px)",background:"linear-gradient"}}>
  <div class="container-fluid">
    <a class="navbar-brand"> <img
    src={OsumareLogo}
    /></a>
      <button class="btn btn-outline-success" type="submit">Contect</button>
  </div>
</nav>
   </>);
}
export default Nav;
